import React from "react";

import { menuData } from "../data";

import { motion } from "framer-motion";

import {
  fadeIn,
  staggerContainer,
} from "../variants";

const Menu = () => {
  const {
    title,
    subtitle,
    modelImg,
    menuItems,
    btnText,
  } = menuData;
  return (
    <section className="min-h-[780px]">
      <div className=" h-[780px] bg-menu absolute w-full -z-0 max-w-[1800px]"></div>
      <div className="relative z-10 top-72 lg:top-52">
        <div className="container mx-auto flex flex-col items-center text-center">
          <h2 className="h2 capitalize text-white">
            {title}
          </h2>
          <p>{subtitle}</p>
          <div>
            <img
              src={modelImg}
              alt=""
            ></img>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Menu;
